  return (
    <>
      <Grid>
        <ColorSwatch items={colorsConfig.brand} title="Brand" />
        <ColorSwatch items={colorsConfig.alert} title="Alert" />
        <ColorSwatch items={colorsConfig.legacy} title="Legacy" />
